INSERT INTO `wp_posts` VALUES (1,1,'2018-04-24 22:13:22','2018-04-24 22:13:22','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','trash','open','open','','hello-world__trashed','','','2018-04-24 23:49:33','2018-04-24 23:49:33','',0,'http://127.0.0.1/?p=1',0,'post','',1),(2,1,'2018-04-24 22:13:22','2018-04-24 22:13:22','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://127.0.0.1/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','closed','open','','sample-page__trashed','','','2018-04-24 23:49:50','2018-04-24 23:49:50','',0,'http://127.0.0.1/?page_id=2',0,'page','',0),(3,1,'2018-04-24 22:14:36','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2018-04-24 22:14:36','0000-00-00 00:00:00','',0,'http://127.0.0.1/?p=3',0,'post','',0),(4,1,'2018-04-24 22:29:20','0000-00-00 00:00:00','','Espresso','','auto-draft','open','closed','','','','','2018-04-24 22:29:19','0000-00-00 00:00:00','',0,'http://127.0.0.1/wp-content/uploads/2018/04/espresso.jpg',0,'attachment','image/jpeg',0),(5,1,'2018-04-24 22:29:20','0000-00-00 00:00:00